import './App.scss';
import logo from '../images/logo.png';

function App() {
  return (
    <div className="page">
      <header className="header">
        <img src={logo} alt="Rick and Morty logo in English" className="header__logo" />
      </header>
      <main className="main">
        <form className="main__form">
          <input className="main__form--input" />
        </form>
        <section className="main__section">
          <div className="main__section--card">Card</div>

        </section>
      </main>
    </div>
  );
}

export default App;
